import { ExportImagePlugin } from "./ExportImagePlugin.js";
export async function loadExportImagePlugin(engine, refresh = true) {
    engine.checkVersion("3.9.1");
    await engine.addPlugin(new ExportImagePlugin(engine), refresh);
}
